(1, 'كفالة مادية', '400.00', ' 400 ريال شهرياً وهو مصروف اليتيم الشهرييتم تحويل هذا المبلغ لحساب اليتيم او اليتيمةعبر بطاقة البركة الإلكترونية'),
(2, 'كفالة تعليمية', '400.00', '400 ريال شهرياً يتلقي اليتيم واليتيمة برامج تعليمية وتربوية وتدريبية وحلقات للقرأن الكريم وندوية علمية وفكرية وصحيةوبرامج ثقافية,ونادرمضاني وحفلات تكريم للمتوفقين,ورحلات تربويةتعزز من تفوقهماالعلميوالمعرفي والمهاري'),
(3, 'كفالة أرملة', '300.00', '300 ريال شهرياً ولأنها أم الأيتام وراعيتهم بعد وفاة زوجها رغم ضعفها رعيناها عوضاً عن فقد زوجها'),
(4, 'كفالة جامعية داخل الحفر', '500.00', '500 ريال شهرياً ولأن الجامعة هى بوابة سوق العمل والطالب الجامعى تتعدد حاجاته ومسئولياته وقد يدرس مغترباً او فى كلية أهلية لذا نمنحهما مايكملان به مسيرة مستقبلهما'),
(5, 'كفالة جامعية خارج الحفر', '1000.00', '1000 ريال شهرياً ولأن الجامعة هى بوابة سوق العمل والطالب الجامعى تتعدد حاجاته ومسئولياته وقد يدرس مغترباً او فى كلية أهلية لذا نمنحهما مايكملان به مسيرة مستقبلهما'),
(6, 'كفالة عطاؤك ألوان', '100.00', 'هى كفالة موسميةل15 خدمة تقدم للايتام واليتيمات على مدار السنة مثل كسوة الشتاء_كسوة العيد وهديته_السلع الغذائية الرمضانية_الحقيبة والمستلزمات المدرسية_الزى المدرسي_ الحج والعمرة_الرعاية الطبية');

